import React from "react";
import { useForm} from "react-hook-form";
import Input from "@material-ui/core/Input";
import Button from "@material-ui/core/Button";
import Grid from "@material-ui/core/Grid"



const NotesComponent = () => {

  const { register, handleSubmit } = useForm();
  const onSubmit = (data) => {
    console.log(data);
  };

  return (
    <div>
      <h1 >Add note!</h1>
      <form onSubmit={handleSubmit(onSubmit)}>
        <Grid container>
          <Grid item xs>
            <Input
              name="name"
              inputRef={register}
              placeholder="Name"
            />
          </Grid>
          <Grid item xs>
            <Input
              name="content"
              inputRef={register}
              placeholder="Content"
              multiline
            />
          </Grid>
        </Grid>
        <Grid container>
          <Grid item xs>
            <Button
              type="submit"
              variant="contained"
              color="primary"
              >
              Submit
            </Button>
          </Grid>
        </Grid>
      </form>
    </div>
  );
};

export default NotesComponent;
